import logoWhiteText from '../static/logoWhiteText.png';
import { Link, useLocation } from 'react-router-dom';
import React, { memo } from 'react';

const Header = memo(function Header({user}) {
  const location = useLocation();

  return (
    <header className="flex items-center justify-between bg-lime-900 px-4 sm:px-8 lg:px-12 h-20 sm:h-28">
        <div className="flex items-center">
          <Link to="/">
            <img className="w-32 h-16 sm:w-64 sm:h-60 object-contain" src={logoWhiteText} alt="logo" />
          </Link>
        </div>
        <nav className="flex gap-2 sm:gap-4 lg:gap-8 pr-2 sm:pr-4">
          {(user === null  || user === undefined) ? (
            <>
            <Link to="/register" className="text-white hover:text-gray-300 text-xs sm:text-sm lg:text-lg font-semibold transition-colors duration-200">Register</Link>
            <Link to="/login" className="text-white hover:text-gray-300 text-xs sm:text-sm lg:text-lg font-semibold transition-colors duration-200">Login</Link>
           </>

          ) : (
            <>
              <Link to="/dashboard" className="text-white hover:text-gray-300 text-xs sm:text-sm lg:text-lg font-semibold transition-colors duration-200">Dashboard</Link>
              <Link to="/whatif" className="text-white hover:text-gray-300 text-xs sm:text-sm lg:text-lg font-semibold transition-colors duration-200">Simulation Playground</Link>
              <Link to="/expenses" className="text-white hover:text-gray-300 text-xs sm:text-sm lg:text-lg font-semibold transition-colors duration-200">Expenses</Link>
              <Link to="/goals" className="text-white hover:text-gray-300 text-xs sm:text-sm lg:text-lg font-semibold transition-colors duration-200">Goals</Link>
              <Link to="/savings" className="text-white hover:text-gray-300 text-xs sm:text-sm lg:text-lg font-semibold transition-colors duration-200">Savings</Link>
              <Link to="/profile" className="text-white hover:text-gray-300 text-xs sm:text-sm lg:text-lg font-semibold transition-colors duration-200">Profile</Link>
              <Link to="/logout" className="text-white hover:text-gray-300 text-xs sm:text-sm lg:text-lg font-semibold transition-colors duration-200">Logout</Link>
            </>
          )}
        </nav>
    </header>
  );
});

export default Header;
